CREATE PROCEDURE [Client].[Users_SelectByUser_Current] @AuthUserId int AS BEGIN SET NOCOUNT ON;
SELECT * FROM [Client].[Users] WHERE [UserId] = @AuthUserId
END

CREATE PROCEDURE [Client].[Users_SelectByUser_UpdateProfile]
	@AuthUserId int,
	@DisplayName varchar(50),
	@Email varchar(100)
AS
BEGIN
	SET NOCOUNT ON;

	if( LEN(@DisplayName) <= 1 ) SET @DisplayName = 'My Name Is Invaid';


	UPDATE [Auth].[User] SET
	[DisplayName] = @DisplayName,
	[Email] = @Email
	WHERE	[UserId] = @AuthUserId


	SELECT	*
	FROM	[Client].[Users]
	WHERE	[UserId] = @AuthUserId

END

CREATE PROCEDURE [Auth].[Permission_SelectBy_UserId] @UserId int AS BEGIN SET NOCOUNT ON;
SELECT [PermissionId], [PermissionName], [Title], [IsRead] FROM [Auth].[Permission] WHERE [PermissionId] IN -- Anonymous / All users permissions ( SELECT [PermissionId] FROM [Auth].[RolePermission] RP INNER JOIN [Auth].[Role] R ON RP.[RoleId] = R.[RoleId] WHERE (R.[ApplyToAnon] = 1 OR (R.[ApplyToAllUsers] = 1 AND @UserId > 0)) AND R.[IsActive] = 1 ) OR [PermissionId] IN -- Specifically assigned permissions ( SELECT [PermissionId] FROM [Auth].[RolePermission] RP INNER JOIN [Auth].[Role] R ON RP.[RoleId] = R.[RoleId] INNER JOIN [Auth].[UserRole] UR ON R.[RoleId] = UR.[RoleId] WHERE UR.[UserId] = @UserId AND R.[IsActive] = 1 )
END
